import { html, svg, repeat, classMap, styleMap, ifDefined, unsafeHTML, scopeTag } from "@ui5/webcomponents-base/dist/renderer/LitRenderer.js";

const block0 = (context, tags, suffix) => html`<div class="${classMap(context.classes)}" dir="${ifDefined(context.effectiveDir)}" @click="${context._headerClick}" @keydown="${context._headerKeydown}" @keyup="${context._headerKeyup}" role="${ifDefined(context.ariaHeaderRole)}" aria-labelledby="${ifDefined(context.ariaLabelledByHeader)}" aria-level="${ifDefined(context._ariaLevel)}" aria-roledescription="${ifDefined(context.ariaCardHeaderRoleDescription)}" tabindex="0" id="${ifDefined(context._id)}--header">${ context.hasAvatar ? block1(context, tags, suffix) : undefined }<div class="ui5-card-header-text">${ context.titleText ? block2(context, tags, suffix) : undefined }${ context.subtitleText ? block3(context, tags, suffix) : undefined }</div><div class="ui5-card-header-action">${ context.hasAction ? block4(context, tags, suffix) : block5(context, tags, suffix) }</div></div>`;
const block1 = (context, tags, suffix) => html`<div id="${ifDefined(context._id)}-avatar" class="ui5-card-header-avatar" aria-label="${ifDefined(context.ariaCardAvatarLabel)}"><slot name="avatar"></slot></div>`;
const block2 = (context, tags, suffix) => html`<div id="${ifDefined(context._id)}-title" class="ui5-card-header-title" part="title">${ifDefined(context.titleText)}</div>`;
const block3 = (context, tags, suffix) => html`<div id="${ifDefined(context._id)}-subtitle" class="ui5-card-header-subtitle" part="subtitle">${ifDefined(context.subtitleText)}</div>`;
const block4 = (context, tags, suffix) => html`<slot name="action"></slot>`;
const block5 = (context, tags, suffix) => html`<span id="${ifDefined(context._id)}-status" part="status" class="ui5-card-header-status" dir="auto">${ifDefined(context.status)}</span>`;


export default block0;
